import React from 'react';
import BeachIndex from './BeachIndex'
import UserProfile from './UserProfile'

const Home = props => {
    state={
        view: "home"
    }
    renderView=()=>{
        if(this.state.view === "home"){
            <Home {...props}/>
        }else if(this.state.view === "beaches"){
            <BeachShow {...props}/>
        }else if(this.state.view === "profile"){
            <UserProfile {...props}/>
        }else if(this.state.view === "contact"){
            <Contact {...props}/>
        }
    }
    return (
        <div className="home-background">
        </div>
    )
}

export default Home;
